import Title from '../../components/Title';
import {FiPlus} from 'react-icons/fi'


export default function New(){
  return(
    <div>
      <Header />

      <div className='content'>
        <Title name='Novo chamado'>
          <FiPlus size={25}/>
        </Title>
        <div className='container'>
        
        </div>
      </div>
     
    </div>
  )
}
